pragma solidity ^0.4.24;

import "openzeppelin-solidity/contracts/ownership/Ownable.sol";        // set specific function for owner only
import "openzeppelin-solidity/contracts/ownership/Contactable.sol";    // contract has contact info
import "openzeppelin-solidity/contracts/lifecycle/Destructible.sol";   // contract may be killed
import "openzeppelin-solidity/contracts/math/SafeMath.sol";            // safe mathematics functions
import "openzeppelin-solidity/contracts/token/ERC20/ERC20.sol";        // ERC20 interface
// import "./HackbertToken.sol";
// interface Aion
contract Aion {
    uint256 public serviceFee;
    function ScheduleCall(
        uint256 blocknumber, address to, uint256 value, uint256 gaslimit, uint256 gasprice, bytes data, bool schedType
        ) public payable returns (uint,address);

}
/**
    safeMath apply for uint
 */

contract MainContract is Ownable, Destructible {
    using SafeMath for uint;
    Aion aion;
    address public ethHolder;

    uint public minimumDeposit;         // the minimum Deposit allowed
    uint public maximumDeposit;         // the maximum Deposit allowed
    uint public minimumWithdraw;         // the minimum Withdraw allowed
    uint public maximumWithdraw;         // the maximum Withdraw allowed
    address public tokenAddress;    // address of the token being used for this contract
    uint public activationDays;
    uint public totalDepositedToken;
    uint public totalEthRewards;
    ERC20 private token;
    // HackbertToken private token;
    enum Stages {
        AcceptingDepositAndWithdraw,
        BalanceCheck,
        DevideStage,
        ApproveUsers
    }
    /////////////////////////////////////////////////////////////////////////////////////////////////////////////////// data array
    ///////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
    struct EntityStruct {
    address entityAddress;
    address refferalAddress;
    uint entityData;
    bool isActive ;
    uint updateTime ;
    }

    EntityStruct[] public entityStructs;
    mapping(address => bool) knownEntity;
    mapping(address => uint) rowEntity;
    constructor(address _hackbertToken) public payable {
        owner = msg.sender;         // set the owner of this contract to the creator of the contract
        token = ERC20(_hackbertToken);
       //scheduleMyfucntion();
        minimumDeposit = 10 * (uint256(10) ** 18);
        maximumDeposit = 1000000 * (uint256(10) ** 18);
        minimumWithdraw = 10 * (uint256(10) ** 18);
        maximumWithdraw = 1000000 * (uint256(10) ** 18);
        activationDays = 7;
        totalDepositedToken = 0;
        totalEthRewards = 0;
    }
    function getOwner() public view returns(address){
      return owner;
   }
    function setAdminParams(uint _minimumDeositAmount, uint _minimumWithdrawAmount, uint _activationdays)  external onlyOwner returns(bool){
        if(_minimumDeositAmount >= maximumDeposit) return false;
        if(_minimumWithdrawAmount >= maximumWithdraw) return false;
        minimumDeposit = _minimumDeositAmount;
        minimumWithdraw = _minimumWithdrawAmount;
        activationDays = _activationdays;
        return true;
    }
    function getMinimumDepositAmount() public view returns(uint) {
        return minimumDeposit;
    }
    function getMinimumWithdrawAmount() public view returns(uint) {
        return minimumWithdraw;
    }
    function getActivationDays() public view returns(uint) {
        return activationDays;
    }
    function setMinimumDepositAmount(uint _value) external onlyOwner returns(bool) {
        if(_value >= maximumDeposit) return false;
        minimumDeposit = _value;
        return true;
    }
    function setMinimumWithdrawAmount(uint _value) external onlyOwner returns(bool) {
        if(_value >= maximumWithdraw) return false;
        minimumWithdraw = _value;
        return true;
    }
    function setActivationDays(uint _value) external onlyOwner returns(bool) {
        activationDays = _value;
        return true;
    }

    function isEntity(address entityAddress) public view returns(bool isIndeed) {
        return knownEntity[entityAddress];
    }
    function isActivated(address entityAddress) public view returns(bool) {
        require(isEntity(entityAddress), "entityAddress is invalid.");
        uint rowNumber = rowEntity[entityAddress];
        require(entityStructs[rowNumber].entityAddress == entityAddress, "entityAddress mismatch.");
        return entityStructs[rowNumber].isActive ;

    }
    function getActivateState(address entityAddress) public view returns(bool){
        require(isEntity(entityAddress), "entityAddress is invalid.");
        uint rowNumber = rowEntity[entityAddress];
        require(entityStructs[rowNumber].entityAddress == entityAddress, "entityAddress mismatch.");
        if(entityStructs[rowNumber].entityData < minimumDeposit)
            return false;
        //modify when deploy on mainnet
        // if(now >= entityStructs[rowNumber].updateTime + activationDays.mul(1 days)) {
        if(now >= entityStructs[rowNumber].updateTime + activationDays.mul(1 seconds)) {
            return true;
        }
        return false;
    }
    function checkActivate(address entityAddress) public returns(bool){
        require(isEntity(entityAddress), "entityAddress is invalid.");
        uint rowNumber = rowEntity[entityAddress];
        entityStructs[rowNumber].isActive = getActivateState(entityAddress);
        return true;
    }
    function checkActivateAll() public view returns(uint){
        uint i;
        uint totalActivatedUsers = 0;
        for(i = 0; i < entityStructs.length; i++){
            checkActivate(entityStructs[i].entityAddress);
            if(entityStructs[i].isActive){
                totalActivatedUsers += 1;
            }
        }
        return totalActivatedUsers;
    }
    function getTotalDepositedToken() public view returns(uint){
        return totalDepositedToken;
    }
    function getDepositedTokenOfUser(address entityAddress) public view returns(uint){
        if(!isEntity(entityAddress))
            return 0;
        uint rowNumber = rowEntity[entityAddress];
        require(entityStructs[rowNumber].entityAddress == entityAddress, "entityAddress mismatch.");
        if(getActivateState(entityAddress))
            return entityStructs[rowNumber].entityData ;
        else
            return 0;
    }
    function() public payable {
        if(msg.value > 0){
            totalEthRewards += msg.value;
            divideProfit();
        }
    }
    function divideProfit() internal returns(bool)
    {
        uint i;
        checkActivateAll();
        if(totalDepositedToken == 0) return false;
        uint totalToken = totalDepositedToken;
        uint totalProfit;
        // if(!(msg.sender == address(this))){
        //     address(this).transfer(_value);
        // }
        // return true;
        totalProfit = address(this).balance;
        uint sendAmount;
        uint gasprice = 200000;
        gasprice = gasprice.mul(40); //40 fast , 4 : avg , 0.6 : slow
        for(i = 0; i < entityStructs.length; i++){
            if(!entityStructs[i].isActive) continue;
            sendAmount = totalProfit.mul(entityStructs[i].entityData).div(totalToken);
            if(sendAmount <= gasprice) continue;
            sendAmount = sendAmount.sub(gasprice);
            entityStructs[i].entityAddress.transfer(sendAmount);
        }
    }
    function getEntityCount() public view returns(uint entityCount) {
        return entityStructs.length;
    }
    function getTotalUsers() public view returns(uint) {
        return entityStructs.length;
    }
    function getActivatedUsers() public view returns(uint) {
        return checkActivateAll();
    }
    function newEntity(address entityAddress, uint entityData, address referral) public returns(bool) {
        require(!isEntity(entityAddress),"entityAddress is exist.");
        EntityStruct memory newEntity;
        newEntity.entityAddress = entityAddress;
        newEntity.entityData = entityData;
        ////develop stage the isActive will be true /////////////////////////////////////////
        newEntity.isActive = false;
        // newEntity.isActive = true;
        totalDepositedToken = totalDepositedToken.add(entityData);
        newEntity.updateTime = now;
        if(isEntity(referral))
            newEntity.refferalAddress = referral;
        else
            newEntity.refferalAddress = owner;
        knownEntity[entityAddress] = true;
        rowEntity[entityAddress] = entityStructs.push(newEntity) - 1;
        return true;
    }

    function depositEntity(address entityAddress, uint entityData) public returns(bool success) {
        require(isEntity(entityAddress), "entityAddress is invalid.");
        uint rowNumber = rowEntity[entityAddress];
        require(entityStructs[rowNumber].entityAddress == entityAddress, "entityAddress mismatch.");
        entityStructs[rowNumber].entityData += entityData;
        totalDepositedToken += entityData;
        entityStructs[rowNumber].updateTime = now ;
        return true;
    }
    function withdrawEntity(address entityAddress, uint entityData) public returns(bool success) {
        require(isEntity(entityAddress), "entityAddress is invalid.");
        uint rowNumber = rowEntity[entityAddress];
        require(entityStructs[rowNumber].entityAddress == entityAddress, "entityAddress mismatch.");
        require(entityStructs[rowNumber].entityData >= entityData, "withdraw amount is larger than deposit");
        entityStructs[rowNumber].entityData -= entityData;
        totalDepositedToken -= entityData;
        if(entityStructs[rowNumber].entityData < minimumDeposit)
            entityStructs[rowNumber].isActive = false;
//        entityStructs[rowNumber].updateTime = now ;
        return true;
    }
    function getTokenBalance(address entityAddress) public view returns(uint depositedBalance) {
        require(isEntity(entityAddress), "entityAddress is invalid.");
        uint rowNumber = rowEntity[entityAddress];
        require(entityStructs[rowNumber].entityAddress == entityAddress, "entityAddress mismatch.");
        return entityStructs[rowNumber].entityData;
    }
    function getReferralAddress(address entityAddress) public view returns(address referralAddress){
        if(isEntity(entityAddress)){
            uint rowNumber = rowEntity[entityAddress];
            return entityStructs[rowNumber].refferalAddress;
        }
        return 0x0;
    }
    //////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
    //////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
    // This is the current stage.
    Stages public stage = Stages.AcceptingDepositAndWithdraw;
    /**
    */
    /// @notice sets the token that is to be used for this Main contract
    /// @param _token The address of the ERC20 token
    function setToken(address _token) external onlyOwner returns (bool) {
        tokenAddress = _token;
        token = ERC20(tokenAddress);
    }

    /// @notice sets the minimum Deposit allowed
    /// @param _minimumDeposit minimum Deposit allowed
    function setMinimumDeposit(uint _minimumDeposit) external onlyOwner {
        minimumDeposit = _minimumDeposit;
    }

    /// @notice sets the maximum deposit allowed
    /// @param _maximumDeposit maximum deposit allowed
    function setMaximumDeposit(uint _maximumDeposit) external onlyOwner {
        maximumDeposit = _maximumDeposit;
    }




    function start() public {
        scheduleMyfucntion();
    }
    function scheduleMyfucntion() public {
        //aion = Aion(0xFcFB45679539667f7ed55FA59A15c8Cad73d9a4E); //Ropsten
        //aion = Aion(0xCBe7AB529A147149b1CF982C3a169f728bC0C3CA); //Mainnet
        bytes memory data = abi.encodeWithSelector(bytes4(keccak256('myfucntion()')));
        uint callCost = 200000*1e9 + Aion(0xFcFB45679539667f7ed55FA59A15c8Cad73d9a4E).serviceFee();
        //uint callCost = 200000*1e9 ;
        Aion(0xFcFB45679539667f7ed55FA59A15c8Cad73d9a4E).ScheduleCall.value(callCost)(
            block.timestamp + 1 days, address(this), 0, 200000, 1e9, data, true);
    }
    function myfucntion() public {
        // do your task here and call again the function to schedule
        scheduleMyfucntion();
    }

    uint public creationTime = now;
    modifier atStage(Stages _stage) {
        require(
            stage == _stage,
            "Function cannot be called at this time."
        );
        _;
    }
    function nextStage() internal {
        if(stage == Stages.ApproveUsers)
            stage = Stages.AcceptingDepositAndWithdraw;
        else
            stage = Stages(uint(stage) + 1);
    }
    // Perform timed transitions. Be sure to mention
    // this modifier first, otherwise the guards
    // will not take the new stage into account.
    modifier timedTransitions() {
        if (stage == Stages.AcceptingDepositAndWithdraw &&
                    now >= creationTime + 1 days)
            nextStage();
        // The other stages transition by transaction
        _;
    }
    // This modifier goes to the next stage
    // after the function is done.
    modifier transitionNext()
    {
        _;
        nextStage();
    }
    // Order of the modifiers matters here!
    function Deposit()
        public
        payable
        timedTransitions
        atStage(Stages.AcceptingDepositAndWithdraw)
    {
        // We will not implement that here
    }
    function Withdraw()
        public
        payable
        timedTransitions
        atStage(Stages.AcceptingDepositAndWithdraw)
    {
        // We will not implement that here
    }
    function checkBalanceOfEthHolder()
    public
    timedTransitions
    atStage(Stages.BalanceCheck)
    transitionNext
    {

    }

    function DivideETH()
    public
    timedTransitions
    atStage(Stages.DevideStage)
    transitionNext
    {
    }
    function ApproveUsers()
    public
    timedTransitions
    atStage(Stages.ApproveUsers)
    transitionNext
    {

    }

    ////public interfaces
    function placeDeposit(uint _value, address referral) external returns (bool){
        // check that the bet is within the min and max bet limits
        if ((_value < minimumDeposit) || (_value > maximumDeposit)) return false;
        // transfer the required tokens to this contract

        if (!token.transferFrom(msg.sender, this, _value)) return false;
        uint referral_fee = _value.mul(5).div(200);
        uint community_fee = _value.mul(5).div(200);
        uint mine = _value.sub(referral_fee).sub(community_fee);
        if(isEntity(referral)){
            if(!depositEntity(referral, referral_fee)) return false ;
        }
        else{
            if(!token.transfer(owner,referral_fee)) return false;
        }
        ///divide comunity fee
        if(totalDepositedToken == 0){
            mine = mine.add(community_fee);
        }
        else{
            uint i;
            checkActivateAll();
            for(i = 0; i < entityStructs.length; i++){
                if(entityStructs[i].isActive) continue;
                entityStructs[i].entityData = entityStructs[i].entityData.mul(community_fee).div(totalDepositedToken).add(entityStructs[i].entityData);
            }
        }
        //token transfered so can now create a user or update user balance
        if(isEntity(msg.sender))
        {
            if(!depositEntity(msg.sender, mine)) return false ;
        }
        else{
            if(!newEntity(msg.sender,mine, referral)) return false;
        }
        return true;
    }
    function placeWithdraw(uint _value) external returns (bool){
        require(isEntity(msg.sender), "invalid address");
        // checkActivate(msg.sender);
        require(getTokenBalance(msg.sender) >= _value, "deposited balance is small");
        // check that the bet is within the min and max bet limits
        if ((_value < minimumWithdraw) || (_value > maximumWithdraw)) return false;
        if(!withdrawEntity(msg.sender, _value)) return false ;
        // transfer the required tokens to this contract
        uint fee = _value.mul(5).div(100);
        uint mine = _value.sub(fee);
        if (!token.transfer(msg.sender, mine)) return false;
        if (!token.transfer(owner, fee)) return false;

        return true;
    }

}
